import React from 'react';
import { View } from 'react-native';
import Form from '../shared/form';
import GenericForm from './f';

const fields = [
  { name: 'User Name', state: 'username', placeholder: 'Enter your email',rules: { required: 'Email is required.', pattern: { value: /\S+@\S+\.\S+/, message: 'Email is invalid.' } } },
  { name: 'First Name', state: 'firstName', placeholder: 'Enter your firstName' ,rules: { required: 'Email is required.', pattern: { value: /\S+@\S+\.\S+/, message: 'Email is invalid.' } } },
  { name: 'Last Name', state: 'lastName', placeholder: 'Enter your lastName' },
  { name: 'Phone Number', state: 'phoneNumber', placeholder: 'Enter your phoneNumber' },
  { name: 'Password', state: 'password', placeholder: 'Enter your password', secureTextEntry: true },
];

const userTypeOptions = [
  { name: 'Select User Type', value: '' },
  { name: 'Therapist', value: 'therapist' },
  { name: 'Treated', value: 'treated' },
];

export default function RegistrationForm() {
  const onSubmit = (data) => {
    // Handle form submission logic
    console.log('Form data:', data);
  };
  return (
    <View>
      {/* user userDetails should come back from the form (as an event?)
    check if fields & userTypeOptions are not null */}
      {/* <Form fields={fields} userTypeOptions={userTypeOptions} ></Form> */}
      <GenericForm fields={fields} onSubmit={onSubmit}></GenericForm>
    </View>
  );
}
